import React from 'react'
import {Row, Col, Span} from 'antd'
import './index.less'
export default class Header extends React.Component {
    render() {
        return (
            <div className="header">
                <Row>
                    <Col span = "15">
                        <Span><a>DashBoard</a></Span>
                        <Span><a>Explore</a></Span>
                        <Span><a>Help</a></Span>
                    </Col>
                    <Col span = "9">
                        <span></span>
                    </Col>
                </Row>
            </div>
        );
    }
}
